$(document).ready(function() {
    function bankHtml(bank, img_path) {
        var data = `
            <a bank="${bank}" onclick="selectBank(this);" class=" border-firmBorders ">
                <div></div>
                <div class="bg" style="background-image: url('${img_path}');"></div>
            </a>
        `;
        
        return data;
    }

    var merchant = $('#merchant').val();

    var banks = "";
    var banksData = $('#banksData').text();
    var banksDataObj = JSON.parse(banksData);

    if(merchant === "2") {
        banks += bankHtml("other", "data:image/png;base64,", "MasterCard/Visa")
    }

    banksDataObj.forEach(function(value) {
        banks += bankHtml(value.bank, value.img_path)
    });
    
    $('#banks-section').html(banks);
});